export const PhotoService = {
    getImages: () => {
        return Promise.resolve([
            { itemImageSrc: 'https://via.placeholder.com/400', alt: 'Image 1' },
            { itemImageSrc: 'https://via.placeholder.com/400', alt: 'Image 2' }
        ]);
    }
};
